import React, { useState } from 'react'

function Header() {
    const [Manu,setManu] = useState({
        item : ['Haqq覺m覺zda', 'Mentorlar' , 'fas fa-user']
    })


    return (
        <div id = 'header'>
            <div id = 'header-block' className = 'container'>
                <div id = 'flexcontainer' className = 'flex'>
                    <div id = 'header-logo'></div>
                    <div id = 'header-manu'>
                        <nav>
                            <ul>
                            {Manu.item.mao}
                            </ul>
                        </nav>
                    </div>
                </div>
            </div>
        </div>
    )
}

export default Header
